import React from 'react';
import { Checkbox } from 'semantic-ui-react'


const SelectMetric = ({keys}) => {

    const ckb = keys.map( (k, i) => <Checkbox slider label={k} style={{marginBottom:10, display: block}} key={i}/> );
    return(
        <div>
            <p>Metrics</p>
            {ckb}
        </div>
    )
}

export default SelectMetric
